import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import logo from './assets/logo.png';
import About from './About';
import Home from './Home';
import Articles from './Articles';
import Animators from './Animators';
import Show from './Show';
import MasterClasses from './MasterClasses';
import Additional from './Additional';
import Portfolio from './Portfolio';
import telegram from './assets/telegram.png';
import whatsapp from './assets/whatsapp.png';

function App() {
  return (
    <Router>
  <nav>
    <Link to="/" className='link1'><img src={logo} width="120px" alt='logo'/></Link>
    <Link to="/about" className='link1'>О нас</Link>
    <Link to="/portfolio" className='link1'>Наши кейсы</Link>
    <Link to="/articles" className='link1'>Статьи</Link> 
    <Link to="tel:9876543210" className='link1'>+7 (499) 877-51-38</Link>
    <button><img src={telegram} alt="telegram"/>Telegram</button>
    <button><img src={whatsapp} alt="whatsapp"/>WhatsApp</button>
    <Link to="/animators" className='link2'>Аниматоры</Link>
    <Link to="/show" className='link2'>Шоу-программы и квесты</Link>
    <Link to="/masterClasses" className='link2'>Мастер-классы</Link>
    <Link to="/additional">Дополнительные услуги</Link>
  </nav>

  <Routes>
       <Route path="/" element={<Home/>}/>
       <Route path="/about" element={<About/>}/>
       <Route path="/portfolio" element={<Portfolio/>}/>
       <Route path="/articles" element={<Articles/>}/>
       <Route path="/animators" element={<Animators/>}/>
       <Route path="/show" element={<Show/>}/>
       <Route path="/masterClasses" element={<MasterClasses/>}/>
       <Route path="/additional" element={<Additional/>}/>
  </Routes>
  </Router>
  );
}

export default App;
